import React from 'react';

const Image = (props) => {
  return (
    <React.Fragment>
    <img
        ref={props.inputRefref}
        className='hidden'
        key={props.image.id}
        src={props.image.image_url}
        alt={props.image.id}
      />
    </React.Fragment>
  )
};

export default Image;
